// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract CertificateRegistry {
    struct Certificate {
        uint256 id;
        string studentName;
        string courseName;
        uint256 issueDate;
        bool isValid;
    }
    
    address public owner;
    mapping(uint256 => Certificate) public certificates;
    
    event CertificateRegistered(uint256 indexed id, string studentName, string courseName);
    event CertificateRevoked(uint256 indexed id);
    
    constructor() {
        owner = msg.sender;
    }
    
    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner can call this function");
        _;
    }
    
    function registerCertificate(
        uint256 _id,
        string memory _studentName,
        string memory _courseName
    ) public onlyOwner {
        require(certificates[_id].id == 0, "Certificate ID already exists");
        
        certificates[_id] = Certificate({
            id: _id,
            studentName: _studentName,
            courseName: _courseName,
            issueDate: block.timestamp,
            isValid: true
        });
        
        emit CertificateRegistered(_id, _studentName, _courseName);
    }
    
    function getCertificate(uint256 _id) public view returns (
        uint256 id,
        string memory studentName,
        string memory courseName,
        uint256 issueDate,
        bool isValid
    ) {
        Certificate memory cert = certificates[_id];
        require(cert.id != 0, "Certificate does not exist");
        
        return (
            cert.id,
            cert.studentName,
            cert.courseName,
            cert.issueDate,
            cert.isValid
        );
    }
    
    function revokeCertificate(uint256 _id) public onlyOwner {
        require(certificates[_id].id != 0, "Certificate does not exist");
        require(certificates[_id].isValid, "Certificate is already revoked");
        
        certificates[_id].isValid = false;
        emit CertificateRevoked(_id);
    }
}
